import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import GridListTileBar from '@material-ui/core/GridListTileBar';
import ListSubheader from '@material-ui/core/ListSubheader';
import IconButton from '@material-ui/core/IconButton';
import InfoIcon from '@material-ui/icons/Info';

import tileData from './mock-restaurants';
import GridListItem from 'components/grid-list-item';

import './grid-list.css'

const styles = theme => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    backgroundColor: theme.palette.background.paper,
  },
  gridList: {
    width: 500
  },
  icon: {
    color: 'rgba(255, 255, 255, 0.54)',
  },
});



function TitlebarGridList() {
  return (
    <div className="root">
      <GridList cellHeight={180} className="grid-list">

        <GridListTile key="Subheader" cols={2} style={{ height: 'auto' }}>
          <ListSubheader component="div">December</ListSubheader>
        </GridListTile>
        {
          tileData.map( ({id, title, author}) => (
                          <GridListTile key={id}>
                            <img src={`/images/restaurants/${id}.jpg`} alt={title} />
                            <GridListTileBar
                              title={title}
                              subtitle={<span>by: {author}</span>}
                              actionIcon={
                                <IconButton className="icon">
                                  <InfoIcon />
                                </IconButton>
                              }
                            />
                          </GridListTile>
                        )
                      )
        }
      </GridList>
    </div>
  );
}

export default TitlebarGridList;
